import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const NavBar = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <nav className="bg-white shadow-lg">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between items-center py-4">
          <Link to="/" className="text-xl font-bold text-blue-600">
            Vault5
          </Link>
          <div className="hidden md:flex space-x-8">
            <Link to="/dashboard" className="text-gray-700 hover:text-blue-600">Dashboard</Link>
            <Link to="/reports" className="text-gray-700 hover:text-blue-600">Reports</Link>
            <Link to="/lending" className="text-gray-700 hover:text-blue-600">Lending</Link>
            <Link to="/loans" className="text-gray-700 hover:text-blue-600">Loans</Link>
            <Link to="/investments" className="text-gray-700 hover:text-blue-600">Investments</Link>
            <Link to="/blog" className="text-gray-700 hover:text-blue-600">Blog</Link>
            <Link to="/settings" className="text-gray-700 hover:text-blue-600">Settings</Link>
            <Link to="/profile" className="text-gray-700 hover:text-blue-600">Profile</Link>
          </div>
          <div className="hidden md:flex items-center space-x-4">
            {token ? (
              <button onClick={handleLogout} className="text-gray-700 hover:text-blue-600">
                Logout
              </button>
            ) : (
              <div className="space-x-2">
                <Link to="/login" className="text-gray-700 hover:text-blue-600">Login</Link>
                <Link to="/register" className="text-gray-700 hover:text-blue-600">Register</Link>
              </div>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
